import React from "react";
import "../signin/signup.css";
export function Signup() {
  return (
    <>
    <form action="#" method="#" className="form-container">
        .field
        <label htmlFor="fname">First Name</label>
        <input type="button" value="" className="firstname" />
    </form>
    </>
  );
}
